        Vector z = soln.minimizer().y;
        Vector soln_p = new SubVectorRef(z, 1, z.size()-1); 
        soln_p = soln_p.scaled(-1);
        
        System.out.println("The solution to the portfolio problem is " + soln_p);
        
        double opt_v;
